import { Link } from "react-router-dom"

export default function Header() {
  return (
    <header>
      <a href="" className="logo">My Blog</a>
      <Link to="/" className="">My Blog</Link>
      <nav>
        <Link to="/login">Login</Link>
        <Link to="/register">Register</Link>
      </nav>
    </header>
  )
}
